ドアミラーに貼り付けるだけ簡単取付！<br>
駐車時の白線など視界を広げたい場合に便利！<br>
<br>
ドアミラーに貼り付けるだけで今まで見えなかった縁石や白線を<br>
見ながら駐車できるので駐車場の白線内に止める場合などに活躍します。<br>
<br>
補助ミラーで死角をサポート！<br>
通常のミラーでは見えない死角を見ることができます。<br>
<br>
バック時に便利！<br>
バック駐車時の子供やものが無いかも確認できるので、<br>
事故防止に役立ちます。<br>
<br>
両面テープ付きで簡単取付！<br>
角度調整可能で見やすい角度に調整できる！<br>
<br>
両面テープが付属しているので、ミラーの好きな場所に簡単に取り付けれます。<br>
また、台座の角度を調整できるので見やすい角度に調整して使用できます。<br>
<br>
ルームミラーに取り付けることで後部座席に座っている子供を確認しやすく<br>
することも可能です。<br>
<br>
商品スペック<br>
サイズ(約)：92×32mm<br>
取り付け：両面テープ<br>
材質：ABS<br>
製造国：中国<br>

