バッテリーの電圧をリアルタイムで監視できる！<br>
車のシガーソケットに接続するだけでバッテリーの<br>
電圧をリアルタイムで監視できます。<br>
<br>
車中泊などで車に長時間いる場合や電気を使うアクセサリーを<br>
沢山つけている際にバッテリーの状態が簡単にわかります。<br>
<br>
電圧計・温度計・時計機能・USB充電で多機能なボルテージメーター！<br>
<br>
電圧計はもちろん温度計やスマートフォンを充電できるUSBポートを搭載！<br>
時計機能を内蔵しているので、時刻を確認する事もできます。<br>
<br>
面倒な配線は不要！シガーソケットに接続するだけ！<br>
<br>
電圧や温度を表示させるのに面倒な配線等は必要なく、シガーソケットに<br>
接続するだけで簡単に表示させることができます。<br>
<br>
USB端子付きでiPhoneなどのスマートフォンを充電できます！<br>
<br>
本体の上部にUSBを接続できるので、車の移動中などにスマートフォンを<br>
充電することができます。<br>
<br>
入力電圧：12/24V<br>
作動温度：-20～60度<br>
出力電圧：5V<br>
最大出力電流：2.1A<br>
温度測定範囲：-9～80度<br>
サイズ(約)：7.5cm×4.7cm<br>
製造国：中国<br>
<br>
