超音波式の加湿器で細かいミストを放出！<br>
USB充電用ポート付きでスマホなどのデバイスを充電できる！<br>
<br>
超音波振動のミストで加湿！<br>
電源を入れると細かいミストが放出し身の回りをしっかりと加湿！<br>
超音波式で動作音が静かで温度が低いので火傷の心配もありません。<br>
<br>
USB充電ポートを搭載！<br>
USBポートを2ポート搭載しているので、2台のデバイスを同時に充電できます。<br>
<br>
自動的に電源が切れる安心設計！<br>
2時間連続運転すると自動的に電源が切れるので空焚き防止できます。<br>
<br>
アーム部分は角度調整可能！<br>
アーム部分はフレキブルアームになっており、角度を自由に決めれます。<br>
<br>
サイズ：68mm×70×210mm<br>
USBポート：DC5V 2.1A<br>
出力効率：1.5-3.5w<br>
入力電圧：12V<br>
タンク容量：50ml<br>
重量：90g<br>
カラー：ブラック、ホワイト<br>
製造国：中国<br>
